// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "../utils/math/SafeMath.sol";
import "../utils/Strings.sol";
import "../interfaces/IProposalFacet.sol";
import "../interfaces/IProposerFacet.sol";
import {LibDiamond} from "../libraries/LibDiamond.sol";
import {LibKeyChain} from "../libraries/LibKeyChain.sol";

contract ProposalFacet is IProposalFacet {
    using SafeMath for uint256;

    event Propose(address indexed proposer, LibDiamond.ProposalType indexed proposalType, uint256 indexed proposalIndex);

    function propose(string memory _ipfsHash, LibDiamond.ProposalType _proposalType, uint256 _startTimestamp, uint256 _endTimestamp, uint256 _optionsCount, uint256 _minimumVotingPower) external override {
        require(IProposerFacet(address(this)).isProposable(msg.sender, _proposalType), "ProposalFacet: proposer unauthorized");
        require(!Strings.equal(_ipfsHash, ""), "ProposalFacet: proposal metadata must not be empty");
        require(_startTimestamp > block.timestamp, "ProposalFacet: proposal start time must be greater than present");
        require(_endTimestamp > _startTimestamp, "ProposalFacet: proposal duration must be greater than zero");
        require(_optionsCount > 1, "ProposalFacet: options count must be greater than one");

        uint maxOptionsCount = LibDiamond.getUint(keccak256(abi.encodePacked(LibKeyChain.KEY_DEFAULT_MAXIMUM_OPTIONS)));
        require(_optionsCount <= maxOptionsCount, "ProposalFacet: options count must be less than or equal to max options count");

        LibDiamond.DiamondStorage storage ds = LibDiamond.diamondStorage();

        uint256[] memory optionVotingPower = new uint256[](_optionsCount);

        uint256 proposalIndex = ds.proposals.length;

        LibDiamond.Proposal memory proposal = LibDiamond.Proposal({
            proposalIndex: proposalIndex,
            ipfsHash: _ipfsHash,
            proposalType: _proposalType,
            proposer: msg.sender,
            startTimestamp: _startTimestamp,
            endTimestamp: _endTimestamp,
            optionsCount: _optionsCount,
            minimumVotingPower: _minimumVotingPower,
            totalVotingPower: 0,
            optionVotingPower: optionVotingPower
        });

        ds.proposals.push(proposal);
        ds.proposalsLength = ds.proposals.length;

        ds.proposalsByType[_proposalType].push(proposal);
        ds.proposalsLengthByType[_proposalType] = ds
            .proposalsByType[_proposalType]
            .length;

        emit Propose(msg.sender, _proposalType, proposalIndex);
    }

    function getProposal(uint256 _proposalIndex)
        public
        view
        override
        returns (LibDiamond.Proposal memory)
    {
        LibDiamond.DiamondStorage storage ds = LibDiamond.diamondStorage();
        return ds.proposals[_proposalIndex];
    }

    function getAllProposal()
        public
        view
        override
        returns (LibDiamond.Proposal[] memory)
    {
        LibDiamond.DiamondStorage storage ds = LibDiamond.diamondStorage();
        return ds.proposals;
    }

    function getAllProposalOfType(LibDiamond.ProposalType _proposalType)
        public
        view
        override
        returns (LibDiamond.Proposal[] memory)
    {
        LibDiamond.DiamondStorage storage ds = LibDiamond.diamondStorage();
        return ds.proposalsByType[_proposalType];
    }

    function getVotingPowers(uint256 _proposalIndex, uint256 _optionIndex)
        public
        view
        override
        returns (uint256)
    {
        LibDiamond.DiamondStorage storage ds = LibDiamond.diamondStorage();
        return ds.proposals[_proposalIndex].optionVotingPower[_optionIndex];
    }

    function getVotingPowersOfAddress(
        uint256 _proposalIndex,
        uint256 _optionIndex,
        address voter
    ) public view override returns (uint256) {
        LibDiamond.DiamondStorage storage ds = LibDiamond.diamondStorage();
        return ds.votedPowers[_proposalIndex][_optionIndex][voter];
    }

    function getDefaultMinimumVotingPowers()
        public
        view
        override
        returns (uint256)
    {
        bytes32 key = keccak256(
            abi.encodePacked(LibKeyChain.KEY_DEFAULT_MINIMUM_VOTE)
        );
        return LibDiamond.getUint(key);
    }

    function isProposalCompleted(uint256 _proposalIndex)
        public
        view
        override
        returns (bool)
    {
        LibDiamond.DiamondStorage storage ds = LibDiamond.diamondStorage();
        LibDiamond.Proposal memory proposal = ds.proposals[_proposalIndex];
        return block.timestamp > proposal.endTimestamp;
    }

    function setDefaultMinimumVotingPowers(uint256 _votingPowers)
        external
        override
    {
        LibDiamond.enforceIsContractOwner();
        _setDefaultMinimumVotingPowers(_votingPowers);
    }

    function _setDefaultMinimumVotingPowers(uint256 _votingPowers) internal {
        bytes32 key = keccak256(
            abi.encodePacked(LibKeyChain.KEY_DEFAULT_MINIMUM_VOTE)
        );
        LibDiamond.setUint(key, _votingPowers);
    }
}
